import React, { useState, useEffect, useMemo } from 'react';

// Ein einfaches Such-Icon
const SearchIcon = ({ className = "w-5 h-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><circle cx="11" cy="11" r="8"></circle><line x1="21" y1="21" x2="16.65" y2="16.65"></line></svg>);

const EBMBrowser = () => {
    const [ebmData, setEbmData] = useState([]);
    const [searchTerm, setSearchTerm] = useState('');
    const [isLoading, setIsLoading] = useState(true);

    useEffect(() => {
        fetch('/ebm_chapter1.json')
            .then(response => response.json())
            .then(data => {
                setEbmData(data);
                setIsLoading(false);
            })
            .catch(error => {
                console.error("Fehler beim Laden der EBM-Daten:", error);
                setIsLoading(false);
            });
    }, []);

    const filteredData = useMemo(() => {
        if (!searchTerm) {
            return ebmData;
        }
        return ebmData.filter(item => 
            item.nummer.includes(searchTerm) ||
            item.titel.toLowerCase().includes(searchTerm.toLowerCase()) ||
            item.leistung.toLowerCase().includes(searchTerm.toLowerCase())
        );
    }, [searchTerm, ebmData]);

    if (isLoading) {
        return <div className="text-center p-10">Lade EBM-Daten...</div>;
    }

    return (
        <div className="bg-white p-6 rounded-lg shadow-xl">
            <h2 className="text-2xl font-semibold text-gray-800 mb-4">EBM-Ziffern (Kapitel 1 - Allgemeine Positionen)</h2>
            <div className="relative mb-6">
                <input 
                    type="text"
                    placeholder="Suche nach Ziffer, Titel oder Leistung..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="w-full pl-10 pr-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-indigo-500"
                />
                <SearchIcon className="w-5 h-5 absolute left-3 top-1/2 -translate-y-1/2 text-gray-400" />
            </div>

            <div className="overflow-x-auto">
                <table className="w-full text-sm text-left text-gray-600">
                    <thead className="text-xs text-gray-700 uppercase bg-gray-100">
                        <tr>
                            <th scope="col" className="px-4 py-3 w-1/12">Ziffer</th>
                            <th scope="col" className="px-4 py-3 w-3/12">Titel / Leistung</th>
                            <th scope="col" className="px-4 py-3 w-1/12 text-right">Punkte</th>
                            <th scope="col" className="px-4 py-3 w-1/12 text-right">Preis (€)</th>
                            <th scope="col" className="px-4 py-3 w-6/12">Anmerkung</th>
                        </tr>
                    </thead>
                    <tbody>
                        {filteredData.map(item => (
                            <tr key={item.nummer} className="bg-white border-b hover:bg-indigo-50">
                                <td className="px-4 py-4 font-mono font-bold text-indigo-700">{item.nummer}</td>
                                <td className="px-4 py-4">
                                    <p className="font-semibold text-gray-800">{item.titel}</p>
                                    <p className="text-xs mt-1">{item.leistung}</p>
                                </td>
                                <td className="px-4 py-4 font-mono text-right">{item.punkte}</td>
                                <td className="px-4 py-4 font-mono text-right">{item.preis}</td>
                                <td className="px-4 py-4 text-xs italic">{item.anmerkung}</td>
                            </tr>
                        ))}
                         {filteredData.length === 0 && (
                            <tr>
                                <td colSpan="5" className="text-center py-10 text-gray-500">
                                    Keine Ergebnisse für "{searchTerm}" gefunden.
                                </td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default EBMBrowser;
